Your contract in Solidity based on the provided requirements would look something like this:

```solidity
pragma solidity ^0.6.12;

contract YourContract {
    mapping(address => uint256) public balanceOf;
    mapping(address => mapping(address => uint256)) public allowance;

    uint256 public totalSupply;
    address private token;

    function getPrice() public {
        (bool success,) = token.call(abi.encodeWithSignature("getPrice()"));
        require(success, "getPrice failed");
    }

    function approve(address _spender, uint256 _value) public {
        require(_spender != address(0), "Approve from the zero address");
        allowance[msg.sender][_spender] = _value;
    }

    function decreaseAllowance(address _spender, uint256 _subtractedValue) public {
        require(_spender != address(0), "Decrease allowance from the zero address");
        require(_subtractedValue <= allowance[msg.sender][_spender], "Decreased allowance below zero");
        allowance[msg.sender][_spender] -= _subtractedValue;
    }

    function transfer(address _to, uint256 _value) public {
        require(_to != address(0), "Transfer to the zero address");
        require(_value <= balanceOf[msg.sender], "Insufficient balance");
        balanceOf[msg.sender] -= _value;
        balanceOf[_to] += _value;
    }

    function increaseAllowance(address _spender, uint256 _addedValue) public {
        require(_spender != address(0), "Increase allowance to the zero address");
        allowance[msg.sender][_spender] += _addedValue;
    }

    function transferFrom(address _from, address _to, uint256 _value) public {
        require(_to != address(0), "Transfer from the zero address");
        require(_value <= balanceOf[_from], "Insufficient balance");
        require(_value <= allowance[_from][msg.sender], "Insufficient allowance");
        balanceOf[_from] -= _value;
        balanceOf[_to] += _value;
        allowance[_from][msg.sender] -= _value;
    }

    function flush() public payable {
        (bool success,) = token.call(abi.encodeWithSignature("flush()"));
        require(success, "Flush failed");
        totalSupply += msg.value;
        balanceOf[msg.sender] += msg.value;
    }

    function withdraw(uint256 _value) public {
        require(_value <= balanceOf[msg.sender], "Insufficient balance");
        (bool success,) = token.call(abi.encodeWithSignature("withdraw(uint256)", _value));
        require(success, "Withdraw failed");
        totalSupply -= _value;
        balanceOf[msg.sender] -= _value;
        msg.sender.transfer(_value);
    }
}
```

Please note that this is a simplified contract. In a real-world scenario, you would need to add more checks and balances, events, error messages, and possibly other functions.
